import React from 'react';


export default class Map3D extends React.Component {
    constructor(){
        super();
        this.buildingsMapRef = React.createRef();
    }

    componentDidMount() {
        var osmb = new OSMBuildings( // eslint-disable-line no-undef
            {
                container: this.buildingsMapRef.current.id,
                position: { latitude: 51.7592, longitude: 19.456 },
                zoom: 16,
                minZoom: 15,
                maxZoom: 22
            });

        osmb.addMapTiles('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png',
            { attribution: '© Data <a href="http://openstreetmap.org/copyright/">OpenStreetMap</a> · © Map <a href="http://mapbox.com">Mapbox</a>' }
        );

        const layer = osmb.addGeoJSONTiles('http://{s}.data.osmbuildings.org/0.2/anonymous/tile/{z}/{x}/{y}.json');
}

    render() {
        return <div style={{ width: '100%', height: '100%' }}><div id="map" style={{ width: '1920px', height: '1080px' }} ref={this.buildingsMapRef} /></div>
    }
}
